$buttonTypes:
    primary,
    secondary,
    tertiary,
    primary-inverse,
    secondary-inverse,
    tertiary-inverse,
    expressive,
    danger,
    facebook,
    paypal,
    trustpilot;

$buttonSizes: large, small;

$buttonFontFamily: var(--semantic-font-family-body);


@mixin buttonColors($buttonType) {
    background-color: var(--component-color-button-#{$buttonType}-background);
    border-color: var(--component-color-button-#{$buttonType}-border);
    color: var(--component-color-button-#{$buttonType}-text);

    .buttonIcon {
        fill: currentColor;
    }
}

@mixin buttonSize($buttonSize) {
    $borderWidth: var(--component-border-width-button);
    $lineHeight: var(--component-size-button-#{$buttonSize}-line-height);
    $buttonMinimumHeight: var(--component-size-button-#{$buttonSize}-height);


    $_calculatedHeight: calc($buttonMinimumHeight / 2);
    $_calculatedLineHeight: calc($lineHeight / 2);


    $paddingX: var(--component-size-button-#{$buttonSize}-padding-x);
    $paddingY: calc($_calculatedHeight - $_calculatedLineHeight - $borderWidth);

    $paddingX--with-icon: calc($paddingX * 2);

    min-height: $buttonMinimumHeight;
    min-width: $buttonMinimumHeight;
    padding-top: $paddingY;
    padding-right: $paddingX;
    padding-bottom: $paddingY;
    padding-left: $paddingX;

    border-width: $borderWidth;

    .button-content {
        display: flex;
        align-items: center;
        gap: var(--component-size-button-#{$buttonSize}-inline-spacing);

        .ui-icon {
            max-height: $lineHeight;
            display: flex;
            align-items: center;
        }

        .ui-text {
            line-height: $lineHeight;
        }
    }



    &.button--has-icon {
        &.button--icon--trailing {
            .button-content {
                flex-direction: row-reverse;
            }
        }

        &.button--icon--only {
            max-width: calc($buttonMinimumHeight - $borderWidth);
        }

    }
}


ui-button {
    button {
        /* Reset */
        border: 0;
        -webkit-appearance: none;
        padding: 0;
        display: inline-flex;
        text-align: center;
        justify-content: center;
        align-items: center;
        border-style: solid;

        font-family: $buttonFontFamily;

        // Button Colors
        @each $buttonType in $buttonTypes {
            &.type-#{$buttonType} {
                @include buttonColors(($buttonType));
            }
        }

        // Button Sizes
        @each $buttonSize in $buttonSizes {
            &.size-#{$buttonSize} {
                @include buttonSize(($buttonSize));
            }
        }

    }
}

